import './App.css';

import Home from './Pages/Home';
import Header from './Components/Header';
import Family_card from './Pages/Family_card';
import Discussion_page from './Pages/Discussion_page';
import Subscribe_plan from './Pages/Subscribe_plan';

import 'bootstrap/dist/css/bootstrap.min.css'
import './style.css';
import { BrowserRouter,Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Header/>
            <Route exact path ="/" component={Home}/>
            {/* <Route path="/Family_card" component={Family_card}/>
            <Route path="/Discussion_page" component={Discussion_page}/>
            <Route path="/Subscribe_plan" component={Subscribe_plan}/> */}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
